// FullAccountGenerator generates a bank account
func FullAccountGenerator(routingNumber, accountNumber string) string {
	return fmt.Sprintf("%s %s", routingNumber, accountNumber)
}

// BankAccountGenerator generates a bank account
func BankAccountGenerator() string {
	return fmt.Sprintf("%9.9d", rand.Intn(1000000000))
}

// BankRoutingGenerator generated a bank routing number for a state
func BankRoutingGenerator(state string) string {
	// Get routing number for state
	list, ok := stateRoutingData[state]

	if !ok {
		// If state doesn't have a local bank grab one at random
		i := 0
		n := rand.Intn(len(stateRoutingData))
		for _, v := range stateRoutingData {
			if i == n {
				list = v
				break
			}
			i++
		}
	}
	return list[rand.Intn(len(list))]
}

